function About(props) {
  return (
    <Page className="about-page">
      <div className="about-container"> 
        <h1>Josh Kim</h1>
        <NavLink to="/project" className="nav-link"> &lt; Developer</NavLink>
        {/* <h2> &lt; Developer</h2> */}
        <h2>Filmmaker &gt;</h2>

        <div className="about-me">
          {/* <h3>About Me</h3>
          <p>lorem</p> */}
        </div>
      </div>
    </Page>
  )
}

export default About;
